import React, { Component } from 'react';
// import '../../App.css';
import { Link } from 'react-router-dom';
import './Navigationbar.css'
import {
    Navbar, Nav, Button,
} from 'react-bootstrap';

class Navigationbar extends Component {


    render() {
        const navLogin = (
            <Nav className="ml-auto">

                <Link
                    id="chartLink"
                    to={{
                        pathname: '/chart',
                    }}
                ><Button id="navbarchart" className="mr-sm-2 navbarbuttons">Chart Data
                    </Button></Link>

                <Link
                    id="tableLink"
                    to={{
                        pathname: '/table',
                    }}
                ><Button className="navbarbuttons">Table Data
                    </Button></Link>
            </Nav>
        );
        return (
            <div>
                <Navbar id="nav-bar">
                    <div className="container">
                        <Navbar.Brand id="nav-brand">
                            <img
                                alt=""
                                src={`${window.location.origin}/sparkcognition-icon.png`}
                                width="30"
                                height="30"
                                className="d-inline-block align-top"
                            />
                            {' '}
                            <Link
                                id="landingPageLink"
                                to={{
                                    pathname: '/',
                                }}
                            >
                            sparkcognition
                            </Link>

                        </Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        {navLogin}
                    </div>
                </Navbar>
            </div>
        );
    }
}


export default Navigationbar;
